import {BrowserRouter,Routes,Route,link, Link} from 'react-router-dom';
import Profile from './Component/Profil';
import Home from './Component/Home';
import About from './Component/About'
import Error from './Component/Error'
export default function App(){
  list={
    tabProduit:[
      {libelle:"Oppo",prix:600,enpromo:Boolean=true,catheg:"tel",img:"./img/Oppo.jpg"},
      {libelle:"Sumsung",prix:670,enpromo:Boolean=false,catheg:"tel",img:"./img/Sumsung.jpg"},
      {libelle:"Infix",prix:500,enpromo:Boolean=true,catheg:"tel",img:"./img/Infix.jpg"}
    ]
  }
  return <div>
    <BrowserRouter>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/About">About</Link>
        <Link to="/Profile">Profile</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/About" element={<About/>}/>
        <Route path="/Profile" element={<Profile/>}/>
        <Route path="/Profile/:id" element={<Profile/>}/>
        <Route path="*" element={<Error/>}/>
      </Routes>
    </BrowserRouter>
  </div>
}
